import React, { Component } from 'react'
import CardsForMarbles from '../Cards/CardsForMarbles'
export default class Marble extends Component {

  render() {
    var marbles = this.props.marble.map( item => {

      return <CardsForMarbles title={marbles.title} description={marbles.description} img={marbles.img}/>
    })
    return (
      <div>

      <div className = "app">
         {marbles}
      </div>

      </div>

    )
  }
}
